function New() {
  return (
    <div className="mb-5">
      <form action="" method="post">
        <button
          disabled
          type="submit"
          className="bg-[#D6DEE8] text-white text-xl h-10 rounded-sm
          hover:bg-[#4D6BFE] hover:cursor-pointer hover:duration-300 hover:ease-out"
        >
          New
        </button>
      </form>
    </div>
  );
}

export default New;
